import React from "react";
import ReactDOM from "react-dom";
var fname,lname;
fname="mujjkir";
lname="ansari";
var i=2;
var j="i have ";
function Funny(name="ansari"){
   var m,n,c;
   m=10;n=9;
   c=m+n;
   return (
      <>
      <h1>{c}</h1>
      <h1>{name}</h1>
    
   </>)

}



ReactDOM.render(
   <>
    <h1>my name is  {`${fname} ${lname} ${i} ${j} legs`}</h1>
    <Funny/>
    </>
 ,document.getElementById("root"));
